(function(L){L.init('pt-br',{idiomas:{"pt-br":{banner_titulo:"",banner_texto:"Nós usamos cookies para melhorar sua experiência de navegação no portal. Ao utilizar o gov.br, você concorda com a política de monitoramento de cookies. Para ter mais informações sobre como isso é feito, acesse <a href=\"#\" id=\"lcb-abre-barra\">Política de cookies</a>. Se você concorda, clique em ACEITO.",botao_primario:"ACEITO",botao_info:"",botao_fechar:"Fechar",info_titulo:"Política de cookies",info_texto:"<h3>O que são cookies?</h3>\n<p>\n  Cookies são arquivos salvos em seu computador, tablet ou telefone quando você\n  visita um site.Usamos os cookies necessários para fazer o site funcionar da\n  melhor forma possível e sempre aprimorar os nossos serviços.\n</p>\n<p>\n  Alguns cookies são classificados como <strong>necessários</strong> e permitem\n  a funcionalidade central, como <strong>segurança</strong>,\n  <strong>gerenciamento de rede</strong> e <strong>acessibilidade</strong>.\n  Estes cookies podem ser coletados e armazenados assim que você inicia sua\n  navegação ou quando usa algum recurso que os requer.\n</p>\n\n<!-- Primarios -->\n<div class=\"lcb-painel\">\n  <input id=\"lcb-cookies-primarios\" class=\"lcb-toggle\" type=\"checkbox\" />\n  <label for=\"lcb-cookies-primarios\" class=\"lcb-painel-titulo\">\n    Cookies Primários\n    <img\n      src=\"data:image/png;base64,\"\n      class=\"lcb-arrow-down\"\n      alt=\"\"\n      aria-hidden=\"true\"\n    />\n    <img\n      src=\"data:image/png;base64,\"\n      class=\"lcb-arrow-up\"\n      alt=\"\"\n      aria-hidden=\"true\"\n    />\n  </label>\n  <div class=\"lcb-painel-conteudo\">\n    <p>\n      Alguns cookies serão colocados em seu dispositivo diretamente pelo nosso\n      site - são conhecidos como <strong>cookies primários</strong>. Eles são\n      essenciais para você navegar no site e usar seus recursos.\n    </p>\n\n    <!-- Temporarios (Primarios) -->\n    <div class=\"lcb-durabilidade\">\n      <h4>Temporários</h4>\n      <p>\n        Nós utilizamos cookies de sessão. Eles são temporários e expiram quando\n        você fecha o navegador ou quando a sessão termina.\n      </p>\n      <div class=\"lcb-finalidade\">\n        <h5>Finalidade</h5>\n        <p>Estabelecer controle de idioma e segurança ao tempo da sessão.</p>\n      </div>\n    </div>\n    <!-- Temporarios (Primarios) -->\n\n    <!-- Persistentes (Primarios) -->\n    <div class=\"lcb-durabilidade\">\n      <h4>Persistentes</h4>\n      <p>\n        Utilizamos também cookies persistentes que permanecem em seu disco\n        rígido até que você os apague ou seu navegador o faça, dependendo da\n        data de expiração do cookie. Todos os cookies persistentes têm uma data\n        de expiração gravada em seu código, mas sua duração pode variar.\n      </p>\n      <div class=\"lcb-finalidade\">\n        <h5>Finalidade</h5>\n        <p>Coletam e armazenam a ciência sobre o uso de cookies no site.</p>\n      </div>\n    </div>\n    <!-- Persistentes (Primarios) -->\n  </div>\n</div>\n<!-- Primarios -->\n\n<!-- Terceiros -->\n<div class=\"lcb-painel\">\n  <input id=\"lcb-cookies-terceiros\" class=\"lcb-toggle\" type=\"checkbox\" />\n  <label for=\"lcb-cookies-terceiros\" class=\"lcb-painel-titulo\">\n    Cookies de Terceiros\n    <img\n      src=\"data:image/png;base64,\"\n      class=\"lcb-arrow-down\"\n      alt=\"\"\n      aria-hidden=\"true\"\n    />\n    <img\n      src=\"data:image/png;base64,\"\n      class=\"lcb-arrow-up\"\n      alt=\"\"\n      aria-hidden=\"true\"\n    />\n  </label>\n  <div class=\"lcb-painel-conteudo\">\n    <p>\n      Outros cookies são colocados no seu dispositivo não pelo site que você\n      está visitando, mas <strong>por terceiros</strong>, como, por exemplo, os\n      sistemas analíticos.\n    </p>\n\n    <!-- Temporarios (Terceiros) -->\n    <div class=\"lcb-durabilidade\">\n      <h4>Temporários</h4>\n      <p>\n        Nós utilizamos cookies de sessão. Eles são temporários e expiram quando\n        você fecha o navegador ou quando a sessão termina.\n      </p>\n      <div class=\"lcb-finalidade\">\n        <h5>Finalidade</h5>\n        <p>\n          Coletam informações sobre como você usa o site, como as páginas que\n          você visitou e os links em que clicou. Nenhuma dessas informações pode\n          ser usada para identificá-lo. Seu único objetivo é possibilitar\n          análises e melhorar as funções do site.\n        </p>\n      </div>\n    </div>\n    <!-- Temporarios (Terceiros) -->\n\n    <!-- Persistentes (Terceiros) -->\n    <div class=\"lcb-durabilidade\">\n      <h4>Persistentes</h4>\n      <p>\n        Utilizamos também cookies persistentes que permanecem em seu disco\n        rígido até que você os apague ou seu navegador o faça, dependendo da\n        data de expiração do cookie. Todos os cookies persistentes têm uma data\n        de expiração gravada em seu código, mas sua duração pode variar.\n      </p>\n      <div class=\"lcb-finalidade\">\n        <h5>Finalidade</h5>\n        <p>\n          Coletam informações sobre como você usa o site, como as páginas que\n          você visitou e os links em que clicou. Nenhuma dessas informações pode\n          ser usada para identificá-lo. Seu único objetivo é possibilitar\n          análises e melhorar as funções do site.\n        </p>\n      </div>\n    </div>\n    <!-- Persistentes (Terceiros) -->\n  </div>\n</div>\n<!-- Terceiros -->\n\n<p>\n  Você pode desabilitá-los alterando as configurações do seu navegador,\n  <strong>mas saiba que isso pode afetar o funcionamento do site</strong>.\n</p>\n<p>\n  <a\n    href=\"https://support.google.com/chrome/answer/95647?co=GENIE.Platform%3DDesktop&hl=pt-BR\"\n    target=\"_blank\"\n    >Chrome</a\n  >\n</p>\n<p>\n  <a\n    href=\"https://support.mozilla.org/pt-BR/kb/desative-cookies-terceiros-impedir-rastreamento\"\n    target=\"_blank\"\n    >Firefox</a\n  >\n</p>\n<p>\n  <a\n    href=\"https://support.microsoft.com/pt-br/help/4027947/microsoft-edge-delete-cookies\"\n    target=\"_blank\"\n    >Microsoft Edge</a\n  >\n</p>\n<p>\n  <a\n    href=\"https://support.microsoft.com/pt-br/help/17442/windows-internet-explorer-delete-manage-cookies\"\n    target=\"_blank\"\n    >Internet Explorer</a\n  >\n</p>\n"},"en":{},"es":{}},fonte:"",marca:"logo.png"})})(window.lgpd_cookie_banner);
